var UiObjectBase = require("./ui_object_base.js");
var UiObjectBaseTO = UiObjectBase.UiObjectBaseTO;
var UiObjectBaseDescription = UiObjectBase.UiObjectBaseDescription;

/**
 * The description of a UIAPro calendar test object.
 * @param {Object} [props] Initializes a UIAPro Calendar test object using the supplied property bag.
 * @returns {Calendar} the description object that was initialized.
 * @class Calendar
 * @extends UIAPro.UiObjectBaseDescription
 * @memberof UIAPro
 */
function Calendar(props) {
    var calendarDesc = new UiObjectBaseDescription("Calendar");

    calendarDesc._defineByPropertyBag(props);
    return calendarDesc;
}

/**
 * A UIAPro calendar.
 * @constructor
 * @class CalendarTO
 * @extends UIAPro.UiObjectBaseTO
 * @memberof UIAPro
 */
function CalendarTO(session, description) {
    description = description || Calendar();
    var calendarTO = new UiObjectBaseTO("UIAProCalendar", session, description);
    
    return calendarTO;
}

module.exports.CalendarTO = CalendarTO;
module.exports.Calendar = Calendar;